        uint256 devFee = SafeMath.div(SafeMath.mul(contractBalance, 4), 100);

        UsdtInterface.transfer(dev2, Dev2Fee);
        uint256 winnerAmount = SafeMath.sub(contractBalance, Dev2Fee);
        winnerAmount -= devFee;

        UsdtInterface.transfer(dev, devFee);
